import * as React from "react";
import { AbstractLabelFactory, DiagramEngine } from "storm-react-diagrams";
import { Label } from "../models/Label";
import { LinkLabelWidget } from "../widgets/LinkLabelWidget";


export class LinkLabelFactory extends AbstractLabelFactory<Label> {
	constructor() {
		super("custom");
	}

	generateReactWidget(diagramEngine: DiagramEngine, label: Label): JSX.Element {
		return React.createElement(LinkLabelWidget, {
			model: label
		});
	}

	getNewInstance(initialConfig?: any): Label {
		return new Label("custom");
	}
}
